import React from "react";
import PropTypes from "prop-types"

function Box(props){

    return (
        <>
            <div> I have returned with {props.value} {props.fruit}{props.value !== 1 && "s"}  </div>
        </>
    )
}

Box.defaultProps = {
    fruit: "banana",
    value: 1,
}


export default Box;
